document.addEventListener("DOMContentLoaded",t=>{var e=window.location.pathname;document.querySelectorAll(".test-form").forEach(t=>{t.addEventListener("submit",t=>{t.preventDefault(),fetch(e+"api/stock-prices?"+new URLSearchParams(new FormData(t.target)).toString(),{method:"GET"}).then(t=>{if(t.ok)return t.json();throw"Error"}).then(t=>{document.querySelector("#result-json").textContent=JSON.stringify(t)}).catch(t=>{console.log(t)})})})});